        setParks(newParks);
    }*/

    return (  
        <div className="home">
        <h2>Homepage</h2>
            { error && <div>{ error }</div> }
            { isPending && <div>Loading...</div> }
            { parks && <Parks parks={parks.data} /> }
        </div>
    );
}

export default Home;
